// ВРЕМЕННЫЙ ФАЙЛ ДЛЯ ДИАГНОСТИКИ
import React, { useEffect, useState, useCallback } from "react";
import Header from "./components/Header";
import Login from "./components/auth/Login";
import Register from "./components/auth/Register";
import { authAPI, courseAPI, userAPI } from './services/api';
import { courseStructure } from './taskGenerators';
import * as taskGenerators from './taskGenerators';
import { useTranslation } from 'react-i18next';
import DayNavigation from './components/DayNavigation';

console.log('🔧 App.js загружен - ВЕРСИЯ ДИАГНОСТИКИ');

function App() {
  const { t, i18n } = useTranslation();
  const [tests, setTests] = useState([]);
  const [answers, setAnswers] = useState({});
  const [loading, setLoading] = useState(true);
  const [user, setUser] = useState(null);

  useEffect(() => {
    console.log('🔄 EFFECT: Проверка аутентификации');
    const checkAuth = async () => {
      const token = localStorage.getItem('authToken');
      if (!token) {
        setUser({ name: "Гость", isLoggedIn: false });
        setLoading(false);
        return;
      }

      try {
        const response = await authAPI.getMe();
        setUser({ ...response.data, isLoggedIn: true });
        console.log('✅ Пользователь авторизован:', response.data.username);
      } catch (error) {
        console.log('❌ Ошибка аутентификации');
        setUser({ name: "Гость", isLoggedIn: false });
      } finally {
        setLoading(false);
      }
    };

    checkAuth();
  }, []);

  useEffect(() => {
    if (!loading && user) {
      console.log('🔄 EFFECT: Загрузка данных пользователя, isLoggedIn:', user.isLoggedIn);
      if (user.isLoggedIn) {
        loadUserData();
      }
    }
  }, [user, loading]);

  const loadUserData = async () => {
    console.log('📥 Начало загрузки данных пользователя');

    try {
      // 1. Пробуем загрузить задания из БД
      console.log('🔄 Запрос заданий из БД...');
      const serverTasks = await userAPI.getAllTasks();
      console.log('📥 Ответ от userAPI.getAllTasks():', serverTasks.data);

      if (serverTasks.data && Object.keys(serverTasks.data).length > 0) {
        console.log('✅ Задания загружены из БД');
        const serverTests = Object.keys(serverTasks.data).map(dayStr => {
          const day = parseInt(dayStr);
          const dayTasks = serverTasks.data[dayStr];
          const dayInfo = courseStructure.find(d => d.day === day) || {
            titleKey: `days.day${day}`,
            theoryLink: null
          };

          return {
            day: day,
            titleKey: dayInfo.titleKey,
            theoryLink: dayInfo.theoryLink,
            tasks: dayTasks
          };
        });

        console.log('🔄 Устанавливаем задания из БД:', serverTests.length, 'дней');
        setTests(serverTests);
        localStorage.setItem('userMathTests', JSON.stringify(serverTests));

        // 2. Загружаем ответы
        console.log('🔄 Запрос ответов из БД...');
        const answersResponse = await userAPI.getAnswers();
        console.log('📥 Ответ от userAPI.getAnswers():', answersResponse.data);

        if (answersResponse.data) {
          const transformedAnswers = {};
          Object.keys(answersResponse.data).forEach(day => {
            Object.keys(answersResponse.data[day]).forEach(taskIndex => {
              const answerData = answersResponse.data[day][taskIndex];
              transformedAnswers[`${day}-${taskIndex}`] = answerData.answer || '';
            });
          });

          console.log('🔄 Устанавливаем ответы из БД:', Object.keys(transformedAnswers).length, 'ответов');
          setAnswers(transformedAnswers);
          localStorage.setItem('userMathAnswers', JSON.stringify(transformedAnswers));
        }

      } else {
        console.log('❌ В БД нет заданий, нужно сгенерировать');
        // Здесь будет генерация
      }

    } catch (error) {
      console.log('❌ Ошибка загрузки данных:', error);
    }
  };

  // Остальной код временно упрощен для диагностики
  return (
    <div className="min-h-screen bg-gray-50">
      <Header user={user || { name: "Гость", isLoggedIn: false }} />

      {loading ? (
        <div className="flex items-center justify-center h-64">
          <div>Загрузка...</div>
        </div>
      ) : (
        <div className="container mx-auto p-4">
          <h1 className="text-2xl font-bold mb-4">Диагностика загрузки данных</h1>
          <div className="bg-white p-4 rounded shadow">
            <p>Пользователь: {user?.username || 'Гость'}</p>
            <p>Статус: {user?.isLoggedIn ? 'Авторизован' : 'Гость'}</p>
            <p>Загружено дней: {tests.length}</p>
            <p>Загружено ответов: {Object.keys(answers).length}</p>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
